import reactDom from 'react-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import Button from '@restart/ui/esm/Button';
import { Container } from 'react-bootstrap';
import { Navbar } from 'react-bootstrap';
import { Nav } from 'react-bootstrap';
import { NavDropdown } from 'react-bootstrap';
import { Form } from 'react-bootstrap';
import { FormControl } from 'react-bootstrap';
import { Image } from 'react-bootstrap';




function App() {
  return (
    <Navbar bg="black" expand="lg" style={{ height: "80px" }}>
      <Container fluid>

        <Navbar.Brand href="#" style={{ color: "white" }}>
          <Image src='https://i.ytimg.com/vi/JzYpex_0s5k/maxresdefault_live.jpg' style={{ height: "80px" }}></Image>
          World of Tanks
        </Navbar.Brand>
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
            navbarScroll
          >
          </Nav>
          <Form className="d-flex">
            <FormControl
              class="form-control me-3" type="search" placeholder="Поиск..." aria-label="Search"
            />
            <Button class="btn btn-outline-light" type="reset">все</Button>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar >
  )

}

export default App;
